import logo from './logo.svg';
import './App.css';
import { Parallax } from 'react-parallax';
import { NaviBarComponent } from './components/NavigationBar';

const insideStyles = {
  padding: 20,
  position: "absolute",
  top: "50%",
  left: "50%",
  transform: "translate(-50%,-50%)"
};

function App() {
  return (
    <div className="App">
      <NaviBarComponent />
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>

      <Parallax className='mr-auto'

        strength={200}
        renderLayer={(percentage) => (
          <div >
            <div
              style={{
                position: "absolute",
                marginLeft:"50%",
                borderRadius:"50%",
                left:"50%",
                top: "50%",
                margin: "auto",
                transform: "translate(-50%,-50%)",
                width: percentage * 500,
                height: percentage * 500,
                backgroundImage: "url('https://lh3.googleusercontent.com/9kop0nj0SZ_btp7bxb8hSviULIcUX4B-2QJ8rUO3WOA0J5oQ49v2ymLWJtaWQMbb_zXqFa26dLyZIG95DBb2yfKl9YMBKCVgfYExKu8tat3YVMXt1c2uTEAXObAo3r41BsoweB6KCNYevdr604SNmffp2rEI6JlEwiUoRl42vCthHcxhnPNSZJdxAMndGh5pea-kTlZVtXjd38ilWftrtBVVo7MF0slxpE8Xe4bzrg8GvaMYGE6C3LahRcm9TtXk8WFStzcwYqvp1QCo3Zn-RP6ptufzsIVHmaRmL6wAUmwzf039HC7o9z8S8eaR47k98z4SatsU-uTQ7BFJqsfzwY3pMF8z8Jc7_MZwuB7X9N_ESn3lsNLBz7xDnH5fhTLn3dmp05uoHviRg16tQST30LD7xHS1vh1j0S-dQXP1ZzwIUBM1WXAZC_qMajHbfsjTETXTJaSfcNeDNTlGnv4NdSxaNW0U8ZVQ20tzY1bjxpHbE9rakf1RsF9lN5cjweZU9Md8Piprdxs8y6u8fcHCVXm12fKgq2R7-ppWxW2wohmZz-OTm8-lSyZZIPED92ZWDKDW4XJVL0qBH0iHGiXR3dgceADbX0d_mXhXWtu8kGLfa-CDN2eU2tpa5puGyxPpjqSkkXwAx9i1rnAi2KQykae0hpH7o0s3nSHP_3A1a3aaKN5OA27KX09hxRjyxAP3eaMNT4CgpnBNGl35MCRUkCYvTal9uwknzTMuw3cqvCOb-oRFjqFjcZzL2Vm_Pjf_RGxUkx9j0oPSAB8su7CQxlksE85AYThJNrQGEo8ToGVzstzb3ky9TT4HQKOR3QZxyAxC02Ok=w587-h879-no?authuser=0')",
                border: "lavender 5px solid"
              }}
            />
          </div>
        )}
      >
        <div style={{ height: 539 }}>
          <div style={insideStyles}>
          </div>
        </div>
        <p>Gurjit is an aspiring software developer currently studying at the University of Maryland - College Park.</p>
      </Parallax>
    </div>
  );
}

export default App;
